	parser = argparse.ArgumentParser(usage=help)
	subparser = parser.add_subparsers(dest='mode', required=True, help='Choose the Shell Module')

	parser_revshells = subparser.add_parser('revshell', help='Reverse Shell Module')
	parser_webshells = subparser.add_parser('webshell', help='Web Shell Module')

	parser_revshells.add_argument('--nologo', action='store_true', help='Cover the shgen logo')
	parser_webshells.add_argument('--nologo', action='store_true', help='Cover the shgen logo')

	parser_revshells.add_argument('--list', action='store_true', help='List Reverse-Shells library')
	parser_revshells.add_argument('--lhost', type=str, help='Attacker IP Address')
	parser_revshells.add_argument('--lport', type=str, help='Attacker Port')
	parser_revshells.add_argument('-s', type=str, help='Select a shell')
	parser_revshells.add_argument('-o', type=str, help='Output file')

	parser_webshells.add_argument('--list', action='store_true', help='List Web-Shells library')
	parser_webshells.add_argument('-s', type=str, help='Select a shell')
	parser_webshells.add_argument('-o', type=str, help='Output file')

	args = parser.parse_args()

	if not args.nologo:
		print (logo)

	show = False
	if args.mode == 'revshell':
		if args.list:
			print ('### \033[32mAVAILABLE REVSHELLS\033[m ###')
			for sh in sorted(revshells):
				print (f'[\033[32m+\033[m] {sh}')
			print ('### ================== ###')
			exit(0)
		if args.o:
			show = True
		if not args.s:
			print (f'[\033[31m-\033[m] Select a shell!')
			exit(0)
		if not args.lhost or not args.lport:
			print (f'[\033[31m-\033[m] Missing lhost or lport argumments.')
			exit(0)
		genrev(args.lhost, args.lport, args.s, show, args.o)
	elif args.mode == 'webshell':
		if args.list:
			print ('### \033[32mAVAILABLE WEBSHELLS\033[m ###')
			for sh in sorted(webshells):
				print (f'[\033[32m+\033[m] {sh}')
			print ('### ================== ###')
			exit(0)
		if args.o:
			show = True
		if not args.s:
			print (f'[\033[31m-\033[m] Select a shell!')
			exit(0)
		genweb(args.s, show, args.o)
	else:
		print ('Invalid Option!!!')
